import './App.css';
import One from './components/header';
import Footer from './components/footer';
function App() {
  return (
    <div className="App">
      <div className="App-header">
        <One />
        <div className="bgContainer">
          <form>
            <input className="inp" type="text" placeholder="Enter any text" />
            <div className="btn" >
              <button type="submit" class="btnStyle" >Click me</button>
            </div>
          </form>
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default App;
